import { color } from "chart.js/helpers";
import React, { Component } from "react";

// Complete this Component
const ListItem = () => {
  const { name, link, icon, bgColor } = this.props.item;
  return (
    <div
      className="ListItem"
      style={{
        height: 30,
        color: { bgColor },
      }}
    >
      <img src={icon} alt="" />
      <a href={link}>{name}</a>
    </div>
  );
};

export default ListItem;
